function _build() {
	var nav = document.createElement("nav");
	nav.className = "nav-menu";
	var ul = document.createElement("ul");
	ul.className = "clearfix";
	for (var ii = 0, jj = _data.modules.length; ii < jj; ii++) {
		ul.appendChild(_addModule(_data.modules[ii]));
	}
	nav.appendChild(ul);




	var wrapper = document.createElement("div");
	wrapper.className = "wrapper";
	wrapper.appendChild(nav);

	var headerMenu = document.createElement("div");
	headerMenu.className = "header";
	headerMenu.appendChild(wrapper);

	var header = document.createElement("header");
	header.className = "header";
	header.appendChild(headerMenu);
	return header;
};

function _addModule(module) {
	var li = document.createElement("li");
	li.className = "top-tier";
	var title = document.createElement("span");
	title.textContent = module.title;
	li.appendChild(title);

	var ul = document.createElement("ul");
	ul.className = "std-menu";
	for (var ii = 0, jj = module.submodules.length; ii < jj; ii++) {
		ul.appendChild(_addSubModule(module.submodules[ii]));
	}
	li.appendChild(ul);
	return li;
}



function _addSubModule(submodule) {
	var li = document.createElement("li");
	li.className = "menu-group";
	var title = document.createElement("span");
	title.textContent = submodule.title;
	li.appendChild(title);

	var slot = document.createElement("div");
	slot.className = "sub-menu-wrap";
	slot.style.display = "block";

	_addItems(slot, submodule.items);

	li.appendChild(slot);
	return li;
}

function _addItems(parentNode, items) {
	for (var ii = 0, jj = items.length; ii < jj; ii++) {
		var item = items[ii];
		if (item.menuItem) {
			var link = document.createElement("a");
			link.textContent = item.menuItem.title;
			var li = document.createElement("li");
			li.appendChild(link);
			parentNode.appendChild(li);
		} else {
			if (item.menuBlock) {
				var slot = document.createElement("div");
				slot.className = "menu-section";
				var li = document.createElement("li");
				li.className = "sub-heading";
				li.textContent = item.menuBlock.title;
				var ul = document.createElement("ul");
				ul.appendChild(li);
				_addItems(ul, item.menuBlock.items);
				slot.appendChild(ul);
				parentNode.appendChild(slot);
			}
		}
	}
}

function _useAim() {

	var $menu = $(".nav-menu .std-menu");
	$menu.menuAim({
		activate: activateSubmenu,
		deactivate: deactivateSubmenu,
		exitMenu: exitSubmenu
	});

	function activateSubmenu(row) {
		var $row = $(row),
			$submenu = $row.find(".sub-menu-wrap"); //,
		// Show the submenu
		$submenu.css({
			display: "block"
		});

		$row.find("span:first").addClass("active");
	}

	function deactivateSubmenu(row) {
		var $row = $(row),
			$submenu = $row.find(".sub-menu-wrap");

		// Hide the submenu and remove the row's highlighted look
		$submenu.css("display", "none");
		$row.find("span:first").removeClass("active");
	}

	function exitSubmenu(row) {
		var $row = $(row);
		$row.find(".sub-menu-wrap").hide().eq(0).show();
	}

	$(".nav-menu .std-menu li").click(function(e) {
		e.stopPropagation();
	});

	$menu.find(".menu-section li:not('.sub-heading')").click(function() {
		$(".std-menu").addClass("deactive").find("> li:not(:first-child) .sub-menu-wrap").css("display", "none");
		$(".nav-menu span.active").removeClass("active");
	});

	$(".nav-menu .top-tier").hover(function() {
		$(this).find(".active").removeClass("active");
		$(this).find("li:first span:first").addClass("active");
		$(this).find(".deactive").removeClass("deactive");
	}, function() {
		$(this).find("li:first span:first").removeClass("active");
	});

	$(".nav-secondary > ul > li:eq(1) a ").mouseenter().addClass("strong");

}

exports.load = function(page, finish) {
	syra_site.loadStyleSheet("/syracuse-ui/lib/tests/pages/navigation/megamenu.css", true);
	page.layoutContent.domItem.appendChild(_build());


	_useAim();

	finish(page);
};